import React, { useState } from "react";
import { Form, Button } from "react-bootstrap";
import { connect } from "react-redux";
import { useEffect } from "react";
import { RegisterUserInfo } from "../redux/actions/Register_actions";
import { useNavigate } from "react-router-dom";

const Register = (props) => {
  const [employeeName, setEmployeeName] = useState("");
  const [phone, setPhone] = useState("");
  const navigate = useNavigate();
  const [ecorr, eCorr] = useState("");
  const [pcorr, pCorr] = useState("");

  const submit = (e) => {
    /^[a-zA-Z]*$/.test(employeeName) && employeeName.length != " "
      ? eCorr("")
      : eCorr("Please Coorect your Name");

    // if (ecorr && pcorr !== "") {
    //   console.log("valid");
    // }
    e.preventDefault();
    console.log(ecorr);
    // e.preventDefault();
    // let data = {
    //   employeeName: employeeName,
    //   phone: phone,
    // };
    // console.log(data);
    // props.RegisterUserInfo(data);
    // navigate("/");
  };

  // useEffect(() => {
  //   console.log("registration", props.details);
  // }, [props]);
  const phon = (e) => {
    setPhone(e.target.value);
    /^[(]{0,1}[0-9]{3}[)]{0,1}[-\s\.]{0,1}[0-9]{3}[-\s\.]{0,1}[0-9]{4}$/.test(
      e.target.value
    )
      ? pCorr("")
      : pCorr("Please Coorect your Phone Number");
  };
  return (
    <div className="reg-div">
      <Form className="reg-form">
        <Form.Group className="mb-3 reg-inbox">
          <Form.Control
            type="text"
            placeholder="Your Name"
            onChange={(e) => setEmployeeName(e.target.value)}
            onClick={(e) => eCorr("")}
          />
          <div>{ecorr}</div>
        </Form.Group>

        <Form.Group className="mb-3 reg-inbox" controlId="formBasicEmail">
          <Form.Control
            type="text"
            placeholder="Enter Phone"
            onChange={(e) => phon}
            onClick={(e) => pCorr("")}
          />
          <div>{pcorr}</div>
        </Form.Group>

        <Button
          className="reg-btn"
          variant="primary"
          type="submit"
          onClick={submit}
        >
          Submit
        </Button>
      </Form>
    </div>
  );
};

const mapStateToProps = (state) => ({
  details: state.registraton,
});

const mapDispatchToProps = {
  // getUserInfo,
  RegisterUserInfo,
};

export default connect(mapStateToProps, mapDispatchToProps)(Register);
